import React from 'react'
import InstituteSideBar from '../../components/instituteSideBar'


function InsEvent() {

    const addEvent = [
        {
            name : 'Event name',
            id : 'eventName'
        },

        {
            name : 'Event Description',
            id : 'eventDescription'
            
        },

        {
            name : 'Add Image',
            id : 'addImage',
            type : 'file'
        }


    ]
  return (
    <div>
        <div className="institute">
        <div className="instituteSideBar">
        <InstituteSideBar/>
      </div>

    </div>
    </div>
  )
}

export default InsEvent
